window.bookSummaryJSON = "<p><b>A stunning new adventure set in the kingdoms of the Remnant.</b></p> <p>A formidable outlaw family that claims to be the first among nations.</p> <p>A son destined to lead, thrust suddenly into power.</p> <p>Three fierce young women of the Rahtan, the queen's premier guard.</p> <p>A legendary street thief leading a mission, determined to prove herself.</p> <p>A dark secret that is a threat to the entire continent.</p> <p>When outlaw leader meets reformed thief, a cat-and-mouse game of false moves ensues, bringing them intimately together in a battle that may cost them their lives - and their hearts.</p>"; 
